import React from "react";
import ReactDom from "react-dom";
import Card from './Card';
import Sdata from './Saata';

ReactDom.render(
    <>
        <h1>List of top 5 Netflix Series in 2020</h1>
        <Card
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            sname={Sdata[0].sname}
            link={Sdata[0].link} />
        <Card
            imgsrc={Sdata[1].imgsrc}
            title={Sdata[1].title}
            sname={Sdata[1].sname}
            link={Sdata[1].link} />
        <Card
            imgsrc={Sdata[2].imgsrc}
            title={Sdata[2].title}
            sname={Sdata[2].sname}
            link={Sdata[2].link} />
    </>

    , document.getElementById('root'));
